import React, { Component } from 'react'

class HocA extends Component {
    constructor(props) {
        super(props)
        
        this.state = {
            value:0
        }
    }
    render() {
        return (
            <>
                <div>HocA</div>
                <button className='btn btn-primary' onClick={()=>this.setState({value:this.state.value+1})}>HocA</button>
                {this.state.value}
            </>
        )
    }
}

export default HocA
